INSERT INTO `v1_0b52d19c3bab9981abbabab91a91fc047923e89a7285a6a773a343749b6f6fdd` VALUES ("ＴＰダウンカット", 76030004, "バトル開始時、すべてのモンスターがＴＰダウン\n100％カット状態になる。", "boss_tp_down_cut", 603000406);
INSERT INTO `v1_0b52d19c3bab9981abbabab91a91fc047923e89a7285a6a773a343749b6f6fdd` VALUES ("全属性ボーナス特大アップ", 76030005, "同属性のキャラが４体以上編成されているとき、キャラの属性ボーナスが強化される。", 33, 603000501);
INSERT INTO `v1_0b52d19c3bab9981abbabab91a91fc047923e89a7285a6a773a343749b6f6fdd` VALUES ("ダメージ減衰", 76030005, "すべてのモンスターが一度の行動で受けるダメージ値を減衰させる。ダメージ値が上昇するほど減衰率も上昇する。", 18, 603000502);
INSERT INTO `v1_0b52d19c3bab9981abbabab91a91fc047923e89a7285a6a773a343749b6f6fdd` VALUES ("ＴＰ上昇上限付与", 76030005, "バトル開始時、すべてのキャラのＴＰ上昇の上限値を150にする。", 17, 603000503);
INSERT INTO `v1_0b52d19c3bab9981abbabab91a91fc047923e89a7285a6a773a343749b6f6fdd` VALUES ("物理防御力（ダウン不可）アップ", 76030005, "バトル開始時、すべてのモンスターの物理防御力を中アップさせる。この効果は物理防御力ダウンの影響を受けない。", "boss_def_lower_limit", 603000504);
INSERT INTO `v1_0b52d19c3bab9981abbabab91a91fc047923e89a7285a6a773a343749b6f6fdd` VALUES ("魔法防御力（ダウン不可）アップ", 76030005, "バトル開始時、すべてのモンスターの魔法防御力を中アップさせる。この効果は魔法防御力ダウンの影響を受けない。", "boss_magic_def_lower_limit", 603000505);
INSERT INTO `v1_0b52d19c3bab9981abbabab91a91fc047923e89a7285a6a773a343749b6f6fdd` VALUES ("ＴＰダウンカット", 76030005, "バトル開始時、すべてのモンスターがＴＰダウン\n100％カット状態になる。", "boss_tp_down_cut", 603000506);
